description:
I feel evil submitting this amongst all the amazing, wholesome art this week ;;

I interpreted scale in the form of distance for this piece, I always found it interesting how small scale silhouettes, particularly birds, in art (e.g. in a horizon or further away) were represented through a series of lines or simple shapes, and so I implemented it in a horror-esque element of crows amongst a tree. 

Additional concepts around distanced scale include the idea of tattoos and how large scale images are scaled to fit the body, and lens reflections that capture imagery within a small frame (interpreted through the eye reflections).
